import React, { Fragment, useState } from "react";
import ReactPlayer from "react-player";
import { closeOutline } from "ionicons/icons";

import {
  IonButton,
  IonButtons,
  IonCard,
  IonCardContent,
  IonCardHeader,
  IonCardSubtitle,
  IonCardTitle,
  IonCol,
  IonContent,
  IonGrid,
  IonHeader,
  IonIcon,
  IonItem,
  IonLabel,
  IonList,
  IonListHeader,
  IonRow,
  IonText,
  IonTitle,
  IonToolbar,
} from "@ionic/react";

interface Props {
  onCancel: Function;
}

interface State {}

class PageStretching extends React.Component<Props, State> {
  constructor(props: Props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <Fragment>
        <IonHeader className="ion-no-border" translucent={true}>
          <IonToolbar>
            <IonTitle>STRETCHING</IonTitle>
            <IonButtons slot="start">
              <IonButton onClick={(_) => this.props.onCancel()}>
                <IonIcon icon={closeOutline}></IonIcon>
              </IonButton>
            </IonButtons>
          </IonToolbar>
        </IonHeader>
        <IonContent fullscreen>
          <IonList>
            <IonSlides pager={true}>
              {marketItems.map((item: Asset, index) => (
                <IonSlide key={index}>
                  <IonCard routerLink={"/PageAsset/" + item.name}>
                    <IonCardHeader>{item.name}</IonCardHeader>
                    <IonCardContent>{item.price?.quantity}</IonCardContent>
                    {/* {JSON.stringify(item)}{" "} */}
                  </IonCard>
                </IonSlide>
              ))}
            </IonSlides>
          </IonList>
        </IonContent>
      </Fragment>
    );
  }
}

export default PageStretching;
